INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (10118, 20063115, 8, 2834, "青空の下で謁見", 2, "ペコリーヌとの出会い", 1, 40, 5118061, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "フリーマーケット会場", 91002, 7, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (10118, 20063115, 8, 2835, "未来の騎空団\nマスコット？", 2, "マホとの出会い", 1, 40, 5118062, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "フリーマーケット会場", 91002, 7, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (10118, 20063115, 8, 2837, "お嬢さまからの\n緊急依頼", 2, "アキノとの出会い", 1, 40, 5118063, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "ランドソル市街地", 91002, 7, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (10118, 20063115, 8, 4108402, "黄金色の悩みごと", 2, "ジュンとの出会い", 1, 40, 5118064, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "フリーマーケット会場", 91002, 18, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (10118, 20063115, 8, 4107402, "白熱！　格闘大会！", 2, "カオリとの出会い", 1, 40, 5118065, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "フリーマーケット会場", 91002, 18, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (10118, 20063115, 8, 9000227, "祭り太鼓はオーエドの華", 2, "ニノンとの出会い", 1, 40, 5118066, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "オーエド町", 91002, 16, 1);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (10118, 20063115, 8, 2101181, "人気者は遅れて\nやってくる", 3, "スズナとの出会い", 1, 40, 5118067, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "フリーマーケット会場", 91002, 19, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (10118, 20063115, 8, 4109402, "巫女・ミーツ・魔法少女", 3, "ナナカとの出会い", 1, 40, 5118068, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ランドソル市街地", 91002, 18, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (10118, 20063115, 8, 4305402, "ネズ耳は二度なくなる", 3, "キャル＆コッコロとの出会い", 1, 40, 5118069, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "フリーマーケット会場", 91002, 18, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (10118, 20063115, 8, 4101402, "この出会いにカンパイ！", 3, "ユカリとの出会い", 1, 40, 5118070, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ランドソル市街地", 91002, 18, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (10118, 20063115, 8, 4106402, "陰陽アンサンブル", 3, "アオイとの出会い", 1, 40, 5118071, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "ランドソル市街地", 91002, 18, 0);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (10118, 20063115, 8, 2836, "運試し十番勝負！", 3, "シノブとの出会い", 1, 40, 5118072, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "フリーマーケット会場", 91002, 7, 1);
INSERT INTO `v1_b6a2109c947d88aae5fd65ca6883583001da8786a33a2e43dc0030870ef6c741` VALUES (10118, 20063115, 0, 0, "彼女たちの新たな日常", 1, "オープニング", 0, 0, 5118600, 0, 0, 0, 0, 0);
